import React from "react"
import { Parallax } from 'react-parallax';

const ParallaxImage = () => {
    return(
        <>
    <Parallax bgImage= "../images/profile_pic.jpeg" bgImageAlt="profile pic" strength={200} >
        <div style={{height: 350}}>
        </div>
    </Parallax>
    </>
    )
}

export default ParallaxImage
